            let dropFile = {};
            function update() {
                dropFile = JSON.parse(document.getElementById("start").value);

                canvas.width = 768*6;
                canvas.height = 435*6;
                let context = canvas.getContext("2d");
                context.fillRect(0,0,canvas.width,canvas.height -1);
                context.font = "30px Arial";
                context.fillStyle = "rgba(128, 255, 0, 1)";

                context.textAlign = "left";
                context.lineWidth = 1;
                context.fillText("@FlatIsNice", 768*5 + 13, 435*1 + 30);
                let c = 0;
                let drops = {"-1": 0, "85" : 0, "86" : 0, "87" : 0, "88" : 0};
                for(let world in dropFile.itemdrops)
                    for(let node in dropFile.itemdrops[world])
                        for(let rank in dropFile.itemdrops[world][node])
                            for(let drop in dropFile.itemdrops[world][node][rank]) {
                                c += dropFile.itemdrops[world][node][rank][drop];
                                drops[drop] += dropFile.itemdrops[world][node][rank][drop];
                            }
                context.fillText("Data: poi-statistics, " + c + " reported battle drops", 768*5 + 13, 435*1 + 80);
                context.fillText("お米 x " + drops[85], 768*5 + 13, 435*1 + 120);
                context.fillText("梅干 x " + drops[86], 768*5 + 13, 435*1 + 155);
                context.fillText("海苔 x " + drops[87], 768*5 + 13, 435*1 + 185);
                context.fillText("お茶 x " + drops[88], 768*5 + 13, 435*1 + 220);

                let files = ["01_01", "01_02", "01_03", "01_04", "01_05", "01_06", "02_01", "02_02", "02_03", "02_04", "02_05", "03_01", "03_02", "03_03", "03_04", "03_05", "04_01", "04_02", "04_03", "04_04", "04_05", "05_01", "05_02", "05_03", "05_04", "05_05", "06_01", "06_02", "06_03", "06_04", "06_05"]

                for(let f of files) {
                    let name =  "World " + f.replace(/0/g, "").replace("_", "-");
                    drawMap(name, (parseInt(f.replace(/0/g, "")[2])-1) * 768, 435*(parseInt(f.replace(/0/g, "")[0])-1))
                }
            }
            function drawMap(name, mapx, mapy) {
                console.log(name, mapx, mapy)
                var context = canvas.getContext("2d");
                var img = new Image();
                img.onload = function() {
                    context.drawImage(img, mapx, mapy);
                    context.textAlign = "center";

                    let dropFileSection = dropFile.itemdrops[name.replace("World ", "")];
                    let shipFileSection = dropFile.shipdrops[name.replace("World ", "")];
                    
                    console.log(name)
                    let drewAny = false;
                    for(let node in dropFileSection) {
                        console.log(node)
                        let x = mapx + mapCoords[name][node].x, y = mapy + mapCoords[name][node].y;
                        
                        context.font = "10px Georgia";
                        
                        let drewItem = false;
                        for(let i = 88; i >= 85; i--) {
                            let xOffset = i == 85 ? -23 : 0
                            if(drewItem)
                                xOffset -= 22;
                            let rank = "";
                            if(dropFileSection[node]["A"] && dropFileSection[node]["A"][i + ""]) {
                                rank = "A";
                            } else if(dropFileSection[node]["S"] && dropFileSection[node]["S"][i + ""]) {
                                rank = "S";
                            } else 
                                continue;

                            drawItem(i, x + xOffset, y + 5, rank);
                            drewItem = true;
                        }
                        let shipsTracked = [517, 518, 524, 525, 531, 540, 551, 552, 565];
                        let shipDrops = 0;
                        for(let i of shipsTracked) {
                            let rank = "";
                            if(shipFileSection[node]["A"] && shipFileSection[node]["A"][i + ""]) {
                                rank = "A";
                            } else if(shipFileSection[node]["S"] && shipFileSection[node]["S"][i + ""]) {
                                rank = "S";
                            } else 
                                continue;
                            let yOffset = -40 - shipDrops++ * 37;
                            
                            setTimeout(() => drawItem(i, x - 50, y + yOffset, rank), 250);
                            drewItem = true;
                        }
                        drewAny = drewAny || drewItem;
                        if(!drewItem) continue;

                        context.font = "30px Georgia";
                        context.fillStyle = "rgba(128, 255, 0, .7)";
                        context.beginPath();
                        context.arc(x, y, 5, 0, 2 * Math.PI, false);
                        context.fill();
                        context.fillStyle = "rgba(128, 255, 0, 1)";
                        context.strokeStyle = 'rgba(0, 0, 0, 1)';
                        context.miterLimit = 2;
                        context.lineJoin = 'circle';
                        context.lineWidth = 7;
                        context.strokeText(node, x, y - 10);
                        context.lineWidth = 1;
                        context.fillText(node, x, y - 10);
                    }

                    
                    context.font = "30px Georgia";
                    if(drewAny)
                        context.fillStyle = "rgba(128, 255, 0, 1)";
                    else 
                        context.fillStyle = "rgba(128, 128, 128, 1)";

                    context.textAlign = "left";
                    context.lineWidth = 7;
                    context.strokeText(name, mapx + 15, mapy + 33);
                    context.lineWidth = 1;
                    context.fillText(name, mapx + 15, mapy + 33);
                }
                img.src = mapCoords[name].image;
            }

            function drawItem(item, x, y, rank) {
                
                console.log(item, x, y, rank)
                var context = canvas.getContext("2d");
                var img = new Image();
                let size = 45;
                if(item > 100) size = 40;
                img.onload = function() {
                    context.drawImage(img, x, y, size, size);
                    if(rank == "A")
                        context.fillStyle = "rgba(244, 16, 0, 1)";
                    else if(rank == "S")
                        context.fillStyle = "rgba(244, 244, 0, 1)";
                    context.font = "20px Georgia";
                    context.textAlign = "center";
                    context.lineWidth = 3;
                    context.strokeText(rank, x+10, y + size-2);
                    context.lineWidth = 1;
                    context.fillText(rank, x+10, y + size-2);
                }
                if(item > 100) {
                    img.src = "https://raw.githubusercontent.com/KC3Kai/KC3Kai/master/src/assets/img/ships/" + item + ".png"
                } else
                    img.src = ["https://vignette.wikia.nocookie.net/kancolle/images/c/c8/Rice_Card.png/revision/latest/scale-to-width-down/" + size,
                            "https://vignette.wikia.nocookie.net/kancolle/images/b/b4/Umeboshi_Card.png/revision/latest/scale-to-width-down/" + size, 
                            "https://vignette.wikia.nocookie.net/kancolle/images/8/81/Nori_Card.png/revision/latest/scale-to-width-down/" + size,
                            "https://vignette.wikia.nocookie.net/kancolle/images/2/24/Tea_Card.png/revision/latest/scale-to-width-down/" + size][item - 85];
            }
            function getJSON(url, callback) {
                var xhr = new XMLHttpRequest();
                xhr.open('GET', url, true);
                xhr.responseType = 'json';
                xhr.onload = function() {
                    var status = xhr.status;
                    if (status === 200) {
                        callback(xhr.response);
                    } else {
                        alert("Error with request " + url + ": " + status);
                    }
                };
                xhr.send();
            };
            update();
        </script>
    </body>
</html>
